class data_loader:

    def __init__(self):
        pass

    def setup_driver(self):
        print("[INFO] Setting up Chrome driver (headless mode)...")
        options = Options()
        options.add_argument("--headless")
        options.add_argument("--window-size=1920,1080")
        options.add_argument("--disable-gpu")
        options.add_argument("--no-sandbox")
        options.add_argument("--disable-dev-shm-usage")
        options.add_argument("--disable-blink-features=AutomationControlled")
        options.add_argument("user-agent=Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/118.0.5993.90 Safari/537.36")
        driver = webdriver.Chrome(options=options)
        driver.set_page_load_timeout(60)
        print("[INFO] Chrome driver initialized (headless).")
        return driver
    
    def select_filters(self, driver, view_option):
        print(f"[INFO] Selecting filters for view: {view_option}...")
        try:
            WebDriverWait(driver, 15).until(EC.presence_of_element_located((By.ID, "filter")))
            print("[DEBUG] View dropdown found.")
            view_dropdown = driver.find_element(By.ID, "filter")
            for option in view_dropdown.find_elements(By.TAG_NAME, "option"):
                if view_option.lower() in option.text.lower():
                    print(f"[DEBUG] Clicking view option: {option.text}")
                    option.click()
                    break
        except Exception as e:
            print(f"[ERROR] Could not select view option: {e}")

        time.sleep(2)

        try:
            sort_dropdown = driver.find_element(By.ID, "sort")
            print("[DEBUG] Sort dropdown found.")
            for option in sort_dropdown.find_elements(By.TAG_NAME, "option"):
                if "Fantasy points per game (last 30)" in option.text:
                    print(f"[DEBUG] Clicking sort option: {option.text}")
                    option.click()
                    break
        except Exception as e:
            print(f"[ERROR] Could not select sort option: {e}")

        time.sleep(3)
    
    def scrape_table(self, driver, max_pages=4):
        print("[INFO] Scraping table data...")
        all_rows = []
        previous_first_row = None
        page = 1
        while page <= max_pages:
            print(f"[DEBUG] Loading page {page}...")
            try:
                WebDriverWait(driver, 10).until(
                    EC.presence_of_element_located((By.CLASS_NAME, "Table__ScrollTable-sc-g4vec0-0"))
                )
                scroll_container = driver.find_element(By.CLASS_NAME, "Table__ScrollTable-sc-g4vec0-0")
                soup = BeautifulSoup(scroll_container.get_attribute("outerHTML"), "html.parser")
                rows = soup.find_all("tr")
                if not rows:
                    print("[WARN] No rows found on page, breaking.")
                    break

                #current_first_row = [cell.get_text(strip=True) for cell in rows[0].find_all("td")]
                #if current_first_row == previous_first_row:
                    #print("[INFO] First row is same as previous. Assuming loop. Breaking.")
                    #break
                #previous_first_row = current_first_row

                for row in rows:
                    cells = [cell.get_text(strip=True) for cell in row.find_all("td")]
                    if len(cells) > 0:
                        all_rows.append(cells)

                print(f"[DEBUG] Collected {len(all_rows)} total rows so far.")
            except Exception as e:
                print(f"[ERROR] Failed to load table or rows: {e}")
                break

            try:
                buttons = driver.find_elements(By.CLASS_NAME, "PaginatorButton__Button-sc-bccamd-0")
                next_button = None
                for btn in buttons:
                    try:
                        span = btn.find_element(By.TAG_NAME, "span")
                        if span.text.strip().lower() == "next":
                            next_button = btn
                            break
                    except:
                        continue

                if not next_button:
                    print("[WARN] Next page button not found.")
                    break

                if "disabled" in next_button.get_attribute("class"):
                    print("[INFO] No more pages to load.")
                    break

                driver.execute_script("arguments[0].click();", next_button)
                print("[DEBUG] Clicked next page.")
                time.sleep(3)
                page += 1
            except Exception as e:
                print(f"[WARN] Failed to click next page: {e}")
                break

        return all_rows

    def get_headers(self, driver):
        print("[INFO] Extracting table headers...")
        try:
            header_container = driver.find_element(By.CSS_SELECTOR, "#root > div:nth-child(3) > div > div > div.Table__ScrollTable-sc-g4vec0-0.hBPEsR > table > thead")
            soup = BeautifulSoup(header_container.get_attribute("outerHTML"), "html.parser")
            headers = ["" if i == 0 else cell.get_text(strip=True) for i, cell in enumerate(soup.find_all("th"))]
            print(f"[DEBUG] Headers found: {headers}")
            return headers
        except Exception as e:
            print(f"[ERROR] Failed to extract headers: {e}")
            return []

    def get_table_for_view(self, view_label):
        print(f"[INFO] Getting table for view: {view_label}")
        driver = self.setup_driver()
        try:
            print("[INFO] Attempting to load page: https://nbafantasy.nba.com/statistics")
            driver.get("https://nbafantasy.nba.com/statistics")
        except Exception as e:
            print(f"[ERROR] Failed to load page: {e}")
            driver.quit()
            return pd.DataFrame()

        time.sleep(3)
        self.select_filters(driver, view_label)
        headers = self.get_headers(driver)
        data = self.scrape_table(driver)
        df = pd.DataFrame(data, columns=headers)
        df["Pos"] = view_label.lower()[:-6]
        driver.quit()
        print(f"[INFO] Total rows collected for {view_label}: {len(data)}")
        return df

    def load_teams(self):
        print("[INFO] Loading teams data...")
        frontcourt = self.get_table_for_view("Front Court")
        backcourt = self.get_table_for_view("Back Court")

        best = pd.concat([frontcourt, backcourt])
        best_filter = best[["Player", "$", "Form", "TP.", "Pos"]].copy()
        best_filter.insert(0, "", range(1, 1 + len(best_filter)))  # index column with no header
        best_filter["team"] = best_filter["Player"].str[-3:]
        best_filter["Player"] = best_filter["Player"].str[:-3].str.strip()
        best_filter["Form"] = pd.to_numeric(best_filter["Form"], errors="coerce")
        best_filter = best_filter[best_filter["Form"] >= 19]
        best_filter = best_filter.sort_values(by="Form", ascending=False).reset_index(drop=True)
        best_filter.to_csv(r'C:\Users\yuval\notebooks\fantasy_manager\data\top_update_players.csv', index=False)
        print("[INFO] Saved filtered team data to CSV.")

        
        
